from collections import Counter

def maximize_suitability(s: str, t: str) -> str:
    s_cnt = Counter(s)
    t_cnt = Counter(t)
    hatena = s_cnt['?']
    (ok, ng) = (0, 10 ** 6 + 1)
    while abs(ok - ng) >= 1:
        mid = ok + ng >> 1
        req = 0
        for (k, v) in t_cnt.items():
            req += max(0, v * mid - s_cnt[k])
        if req <= hatena:
            ok = mid
        else:
            ng = mid
    keys = list(t_cnt.keys())
    s = list(s)
    for i in range(len(s)):
        if s[i] != '?':
            continue
        while keys and t_cnt[keys[-1]] * ok <= s_cnt[keys[-1]]:
            keys.pop()
        if keys:
            s[i] = keys[-1]
            s_cnt[keys[-1]] += 1
        else:
            s[i] = 'a'
    return ''.join(s)

